import React from "react";
import styles from "../css/Login.module.css";

const Login = () => {
  return (
    <div className={styles.LoginWrap}>
      <h3 className={styles.LoginLogo}>
        <img src="" alt="" />
      </h3>
      <p>
        안녕하세요.
        <br />
      </p>
      <span>서비스 이용을 위해 로그인을 해주세요.</span>

      <form action="/login" className={styles.LoginFormWrap}>
        <div className={styles.LoginEmailWrap}>
          <input
            type="email"
            placeholder="ID"
            id="loginEmail"
            className={styles.LoginEmail}
          />
        </div>

        <div className={styles.LoginPasswordWrap}>
          <input
            type="password"
            placeholder="PASSWORD"
            id="LoginPassword"
            className={styles.LoginPassword}
          />
        </div>

        <button className={styles.LoginSubmitButton}>로그인하기</button>
      </form>
    </div>
  );
};

export default Login;
